import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

const SearchFild = () => {
  return (
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1, width: '25ch', borderRadius: 25 },
      }}
      noValidate
      autoComplete="off">
      <TextField
        sx={{}}
        placeholder="Поиск в Твиттере"
        fullWidth
      />
    </Box>
  );
};
export default SearchFild;
